Object.keys(alasql._aggrOriginal).forEach(function(k) {
	alasql.aggr[k] = function(v, s, stage) {
		if (stage === 3 && typeof s === 'undefined') return undefined;
		return alasql._aggrOriginal[k].apply(null, arguments);
	};
});

